#include <array>
#include <cassert>
#include <iostream>
#include <memory>

#include <cuda.h>
#include <cuda_runtime.h>
#include <nvrtc.h>

constexpr char const *src = R"(
constexpr size_t MAX_THREADS = 512;

struct Context {
  int x;
  int y;
};

template <typename Context, typename Body>
static inline __device__ void
kernel_impl(Body body) {
  // init
  __shared__ Context ctx;
  ctx.x = 0;

  // do stuff
  body(ctx);

  // cleanup
  ctx.y = 1;
}

#define PDU_KERNEL(NAME, BODY, CONTEXT)                                        \
  extern "C" __global__ void __launch_bounds__(MAX_THREADS) NAME() {           \
    kernel_impl<CONTEXT>(BODY);                                                \
}

__device__ __forceinline__ void evaluate(Context& ctx) {
  ctx.x++;
}

PDU_KERNEL(___lelebits40141les6495s895les1695les3295les6495lefloat3295lefloat6495ldstring4044195ldstring4044195leutc324014195leutc6440441, evaluate, Context)
)";

int main() {
  nvrtcProgram program;
  nvrtcResult nvrtcStatus;

  nvrtcStatus =
      nvrtcCreateProgram(&program, src, "evaluate_kernel", 0, nullptr, nullptr);
  assert(nvrtcStatus == NVRTC_SUCCESS);

  constexpr std::array options{"-std=c++20",
                               "-diag-suppress=64",
                               "-lineinfo",
                               "-diag-suppress=1866",
                               "-default-device",
                               "-arch=sm_70",
                               "--define-macro=NDEBUG",
                               "--dopt=on"};

  nvrtcStatus = nvrtcCompileProgram(program, options.size(), options.data());
  if (nvrtcStatus != NVRTC_SUCCESS) {
    size_t logSize;
    nvrtcStatus = nvrtcGetProgramLogSize(program, &logSize);
    assert(nvrtcStatus == NVRTC_SUCCESS);

    std::unique_ptr<char[]> log(new char[logSize]);
    nvrtcStatus = nvrtcGetProgramLog(program, log.get());
    assert(nvrtcStatus == NVRTC_SUCCESS);

    std::cout << log;
    std::abort();
  }

  return 0;
}
